style.css:
body {  
    background-color: #f0f0f0;  
    font-family: Arial, sans-serif;  
    color: #333;  
    margin: 0;  
    padding: 20px;  
}  

h1 {  
    color: #2c3e50;  
    font-size: 2.5em;  
}  

p {  
    line-height: 1.6;  
}  

a {  
    color: #2980b9;  
    text-decoration: none;  
}  

a:hover {  
    text-decoration: underline;  
}
